import React, { Component, Fragment } from "react";
import axios from "axios";
class App extends Component {
	constructor() {
		super();
		this.state = {};
	}
	componentWillMount() {
		axios.get("/dogs").then(res => console.log(res));
	}
	render() {
		return (
			<Fragment>
				<div className="container" />
			</Fragment>
		);
	}
}

export default App;
